import { Typography } from '@mui/material';
import './content.css';

export function Projects(props) {
  const style = {fontSize: "1.5vw", fontFamily: "'Annie Use Your Telescope'", color: "#000", marginLeft: "30px"}
  return (
    <div style={{color: "black"}} id="projects" className="none">
      <div className="flex margin-30px">
        <img alt="" src={props.images("./projects/project0.png").default} style={{width: "7vw"}}/>
        <Typography style={style}>Ployem</Typography>
      </div>
    </div>
  )
}
